window.bookSummaryJSON = "<p>Fred did something bad.</p> <p>He didn’t intend to do it, but the destruction of a dungeon core - accident or otherwise - will likely result in horrific consequences for anyone connected with the crime.</p> <p>And not for just the perpetrators; everyone around them will suffer vengeful retribution from the nearby cores for the unthinkable act.</p> <p>Knowing that his mistake will end up endangering his new friends, the townspeople of Gatecross, and even his Guild, Core Power, Fred decides to do whatever he can to protect them.</p> <p>After he absorbed the nature core, he unlocked the ability to establish a territory and create his very own dungeon - a dungeon which will hopefully provide the defense they need to survive against the expected fight to come.</p> <p>Unfortunately, the nature faction isn’t the only one that learned about Fred’s crime.</p> <p>The Dungeon Adventurer Syndicate, under the authority of the Craytion Kingdom, has sent a powerful group to investigate....</p> <p>Contains LitRPG/GameLit elements such as statistics and leveling.</p> <p>No harems and no profanity.</p>"; 
